import React, {Component} from 'react';
import {NavLink, Route, HashRouter} from 'react-dom';
import {ListGroup, Row, Col, Button} from 'react-bootstrap';
import UpdateInfo from './updateInfo';

class MyInfo extends Component {
    render(){
        const div_style={
            margin: 50
        }
        return(
                <HashRouter>
            <div style={div_style}>
                <Col md={{ span: 6, offset: 3 }}>
                    <ListGroup>
                        <ListGroup.Item>나의 게시글</ListGroup.Item>
                        <ListGroup.Item>관심 게시글</ListGroup.Item>
                        <ListGroup.Item>관심 토픽</ListGroup.Item>
                        <ListGroup.Item><NavLink to='/updateInfo'>회원정보 수정</NavLink></ListGroup.Item>
                    </ListGroup>
                </Col>
                <div>
                    <Route path='/updateInfo' component='UpdateInfo'/>
                </div>
            </div>
                </HashRouter>
        );
    }
}

export default MyInfo;
